  },
  {
  name: "Einstein",
  pic: "https://media.istockphoto.com/id/1179420343/photo/smiling-man-outdoors-in-the-city.jpg?s=612x612&w=0&k=20&c=8l-gOboGEFSyCFXr09EguDmV0E0bFT5usAms1wyFBh8=",
  },
  ];
  return (
  <div className="App">
  {users.map((usr) => (
  <User name={usr.name} pic={usr.pic} />
  ))}
  </div>
  );
}
export default App;
